import React from 'react'
import Logo from '../assets/logo.png'
import './Footer.css'
const Footer = () => {
  return (
    <div className='Footer'>
        <hr/>
      <img src={Logo} alt='icon'></img><h1>Shopper</h1>
    </div>
  )
}

export default Footer
